function UpdateArmROrder() {
    var CharComp = null;
    for (var i = 1; i <= app.project.numItems; i++) {
      var item = app.project.item(i);
      if (item instanceof CompItem && item.name === "01_Char") {
        CharComp = item;
        break;
      }
    }//指定Char合成
    var Orders = [
        CharComp.layer("CtrlMain_arm_R").effect("Order").property(1).valueAtTime(CharComp.time,true),
        CharComp.layer("CtrlMain_arm_R").effect("Order").property(2).valueAtTime(CharComp.time,true),
    ]//将Order值储存在数组
    statictext9.text = Orders[0].toFixed(1);
    statictext11.text = Orders[1].toFixed(1);
}
function UpdateArmRSabun() {
    var CharComp = null;
    for (var i = 1; i <= app.project.numItems; i++) {
      var item = app.project.item(i);
      if (item instanceof CompItem && item.name === "01_Char") {
        CharComp = item;
        break;
      }
    }//指定Char合成
    var Sabun = CharComp.layer("Ctrl_wrist_R").effect("Customize").property(1).valueAtTime(CharComp.time,true);
    panel3.text = "差分: " + Sabun;
    if (Sabun == 0) {
        image2.image = ScriptUI.newImage(image2.image);
        image2.image = ScriptUI.newImage(noneImg);
    } else if (Sabun <= 5) {
        image2.image = ScriptUI.newImage(image2.image);
        image2.image = ScriptUI.newImage(shoImages[Sabun-1]);
    } else {
        image2.image = ScriptUI.newImage(image2.image);
        image2.image = ScriptUI.newImage(exImg);
    }
}
function UpdateArmRIKFK() {
    var CharComp = null;
    for (var i = 1; i <= app.project.numItems; i++) {
        var item = app.project.item(i);
        if (item instanceof CompItem && item.name === "01_Char") {
          CharComp = item;
          break;
        }
    }//指定Char合成
    var Layers = [
        CharComp.layer("CtrlMain_arm_R"),
        CharComp.layer("Ctrl_arm_R"),
        CharComp.layer("Ctrl_hand_R"),
        CharComp.layer("Ctrl_wrist_R"),
        CharComp.layer("Ctrl_wrist_R_IK"),
    ]//将目标图层储存进数组中
    var Props = [
        Layers[0].effect("IK to FK").property("Slider"),
        //切换属性
        Layers[1].content.property(1),
        Layers[2].content.property(1),
        Layers[3].content.property(1),
        //FK显示
        Layers[4].content.property(1),
        //IK显示
    ]//将目标属性储存进数组中
    if (Props[0].valueAtTime(CharComp.time,true) > 0) {
        Props[1].enabled = true;
        Props[2].enabled = true;
        Props[3].enabled = true;
        Props[4].enabled = false;
    } else {
        Props[1].enabled = false;
        Props[2].enabled = false;
        Props[3].enabled = false;
        Props[4].enabled = true;
    }
}
function AddArmRKey() {
    var curComp = app.project.activeItem;
    var curTime = app.project.activeItem.time;
    var Layers = [
        curComp.layer("CtrlMain_arm_R"),
        curComp.layer("Ctrl_arm_R"),
        curComp.layer("Ctrl_hand_R"),
        curComp.layer("Ctrl_wrist_R"),
        curComp.layer("Ctrl_wrist_R_IK"),
    ]//将目标图层储存进数组中
    var Props = [
    Layers[0].effect("Customize").property("Round 1"),
    Layers[0].effect("Customize").property("Round 2"),
    Layers[0].effect("Customize").property("Elbow 1"),
    Layers[0].effect("Customize").property("Elbow 2"),
    Layers[0].effect("Order").property("Order 1"),
    Layers[0].effect("Order").property("Order 2"),
    Layers[0].effect("IK to FK").property("Slider"),
    //Main
    Layers[1].rotation, 
    //ArmR
    Layers[2].position, 
    Layers[2].rotation,
    //HandR
    Layers[3].effect("Customize").property(1),
    Layers[3].effect("Customize").property(2),
    Layers[3].effect("Customize").property(3),
    Layers[3].position, 
    Layers[3].rotation,
    //WristR
    Layers[4].effect("IK Control").property("Upper Length"), 
    Layers[4].effect("IK Control").property("Lower Length"), 
    Layers[4].effect("IK Control").property("Rotation Freeze"), 
    Layers[4].effect("IK Control").property("Clockwise"), 
    Layers[4].position, 
    Layers[4].rotation,
    //IK
    ]//将目标属性储存进数组中   
    for (var i = 0; i < Props.length; i++) {
      tarProp = Props[i];
      tarProp.addKey(curTime);
    }//使用循环遍历数组   
}
function SelectArmR() {
    var curComp = app.project.activeItem;
    var curTime = app.project.activeItem.time;
    var Layers = [
        curComp.layer("CtrlMain_arm_R"),
        curComp.layer("Ctrl_arm_R"),
        curComp.layer("Ctrl_hand_R"),
        curComp.layer("Ctrl_wrist_R"),
        curComp.layer("Ctrl_wrist_R_IK"),
    ]//将目标图层储存进数组中
    var Props = [
    Layers[0].effect("Customize").property("Round 1"),
    Layers[0].effect("Customize").property("Round 2"),
    Layers[0].effect("Customize").property("Elbow 1"),
    Layers[0].effect("Customize").property("Elbow 2"),
    Layers[0].effect("Order").property("Order 1"),
    Layers[0].effect("Order").property("Order 2"),
    Layers[0].effect("IK to FK").property("Slider"),
    //Main
    Layers[1].rotation, 
    //ArmR
    Layers[2].position, 
    Layers[2].rotation,
    //HandR
    Layers[3].effect("Customize").property(1),
    Layers[3].effect("Customize").property(2),
    Layers[3].effect("Customize").property(3),
    Layers[3].position, 
    Layers[3].rotation,
    //WristR
    Layers[4].effect("IK Control").property("Upper Length"), 
    Layers[4].effect("IK Control").property("Lower Length"), 
    Layers[4].effect("IK Control").property("Rotation Freeze"), 
    Layers[4].effect("IK Control").property("Clockwise"), 
    Layers[4].position, 
    Layers[4].rotation,
    //IK
    ]//将目标属性储存进数组中   
    for (var i = 0; i < Props.length; i++) {
        tarProp = Props[i];
        if (tarProp.numKeys > 0) {
            keyIndex = tarProp.nearestKeyIndex(curTime);
            keyTime = tarProp.keyTime(keyIndex);
            //如果目标属性有关键帧，则获得离当前时间最近的关键帧
            if (keyTime == curTime) {
              tarProp.setSelectedAtKey(keyIndex,true);
            }//如果关键帧关键帧时间为当前时间，则选中
            
        } 
    }//使用循环遍历数组    
}
function ResetArmR() {
    var curComp = app.project.activeItem;
    var curTime = app.project.activeItem.time;
    var Layers = [
        curComp.layer("CtrlMain_arm_R"),
        curComp.layer("Ctrl_arm_R"),
        curComp.layer("Ctrl_hand_R"),
        curComp.layer("Ctrl_wrist_R"),
        curComp.layer("Ctrl_wrist_R_IK"),
    ]//将目标图层储存进数组中
    Layers[0].effect("Customize").property("Round 1").setValueAtTime(curTime,100);
    Layers[0].effect("Customize").property("Round 2").setValueAtTime(curTime,100);
    Layers[0].effect("Customize").property("Elbow 1").setValueAtTime(curTime,true);
    Layers[0].effect("Customize").property("Elbow 2").setValueAtTime(curTime,false);
    Layers[0].effect("Order").property("Order 1").setValueAtTime(curTime,0.5);
    Layers[0].effect("Order").property("Order 2").setValueAtTime(curTime,0.5);
    Layers[0].effect("IK to FK").property("Slider").setValueAtTime(curTime,100);
    //Main
    Layers[1].rotation.setValueAtTime(curTime,-45);
    //arm
    Layers[2].position.setValueAtTime(curTime,[0,100]);
    Layers[2].rotation.setValueAtTime(curTime,0);
    //hand
    Layers[3].effect("Customize").property(1).setValueAtTime(curTime,0);
    Layers[3].effect("Customize").property(2).setValueAtTime(curTime,false);
    Layers[3].effect("Customize").property(3).setValueAtTime(curTime,false);
    Layers[3].position.setValueAtTime(curTime,[0,100]);
    Layers[3].rotation.setValueAtTime(curTime,0);
    //wrist
    Layers[4].effect("IK Control").property("Upper Length").setValueAtTime(curTime,100);
    Layers[4].effect("IK Control").property("Lower Length").setValueAtTime(curTime,100);
    Layers[4].effect("IK Control").property("Rotation Freeze").setValueAtTime(curTime,false);
    Layers[4].effect("IK Control").property("Clockwise").setValueAtTime(curTime,-100);
    Layers[4].position.setValueAtTime(curTime,[0,0]);
    Layers[4].rotation.setValueAtTime(curTime,0);
    //IK
}
  

