function UpdateLegLIKFK() {
    var CharComp = null;
    for (var i = 1; i <= app.project.numItems; i++) {
        var item = app.project.item(i);
        if (item instanceof CompItem && item.name === "01_Char") {
          CharComp = item;
          break;
        }
    }//指定Char合成
    var Layers = [
        CharComp.layer("CtrlMain_thigh_L"),
        CharComp.layer("Ctrl_thigh_L"),
        CharComp.layer("Ctrl_leg_L"),
        CharComp.layer("Ctrl_ankle_L"),
        CharComp.layer("Ctrl_ankle_L_IK"),
    ]//将目标图层储存进数组中
    var Props = [
        Layers[0].effect("IK to FK").property("Slider"),
        //切换属性
        Layers[1].content.property(1),
        Layers[2].content.property(1),
        Layers[3].content.property(1),
        //FK显示
        Layers[4].content.property(1),
        //IK显示
    ]//将目标属性储存进数组中
    if (Props[0].valueAtTime(CharComp.time,true) > 0) {
        Props[1].enabled = true;
        Props[2].enabled = true;
        Props[3].enabled = true;
        Props[4].enabled = false;
    } else {
        Props[1].enabled = false;
        Props[2].enabled = false;
        Props[3].enabled = false;
        Props[4].enabled = true;
    }
}
function AddLegLKey() {
    var curComp = app.project.activeItem;
    var curTime = app.project.activeItem.time;
    var Layers = [
        curComp.layer("CtrlMain_thigh_L"),
        curComp.layer("Ctrl_thigh_L"),
        curComp.layer("Ctrl_leg_L"),
        curComp.layer("Ctrl_ankle_L"),
        curComp.layer("Ctrl_ankle_L_IK"),
    ]//将目标图层储存进数组中
    var Props = [
    Layers[0].effect("Customize").property("Round 1"),
    Layers[0].effect("Customize").property("Round 2"),
    Layers[0].effect("Customize").property("Elbow 1"),
    Layers[0].effect("Customize").property("Elbow 2"),
    Layers[0].effect("Order").property("Order 1"),
    Layers[0].effect("Order").property("Order 2"),
    Layers[0].effect("IK to FK").property("Slider"),
    Layers[1].rotation, 
    Layers[2].position, 
    Layers[2].rotation,
    Layers[3].effect("Sabun").property("Slider"),
    Layers[3].position, 
    Layers[3].rotation,
    Layers[4].effect("IK Control").property("Upper Length"), 
    Layers[4].effect("IK Control").property("Lower Length"), 
    Layers[4].effect("IK Control").property("Rotation Freeze"), 
    Layers[4].effect("IK Control").property("Clockwise"), 
    Layers[4].position, 
    Layers[4].rotation,
    ]//将目标属性储存进数组中   
    for (var i = 0; i < Props.length; i++) {
      tarProp = Props[i];
      tarProp.addKey(curTime);
    }//使用循环遍历数组   
}
function SelectLegL() {
    var curComp = app.project.activeItem;
    var curTime = app.project.activeItem.time;
    var Layers = [
        curComp.layer("CtrlMain_thigh_L"),
        curComp.layer("Ctrl_thigh_L"),
        curComp.layer("Ctrl_leg_L"),
        curComp.layer("Ctrl_ankle_L"),
        curComp.layer("Ctrl_ankle_L_IK"),
    ]//将目标图层储存进数组中
    var Props = [
    Layers[0].effect("Customize").property("Round 1"),
    Layers[0].effect("Customize").property("Round 2"),
    Layers[0].effect("Customize").property("Elbow 1"),
    Layers[0].effect("Customize").property("Elbow 2"),
    Layers[0].effect("Order").property("Order 1"),
    Layers[0].effect("Order").property("Order 2"),
    Layers[0].effect("IK to FK").property("Slider"),
    Layers[1].rotation, 
    Layers[2].position, 
    Layers[2].rotation,
    Layers[3].effect("Sabun").property("Slider"),
    Layers[3].position, 
    Layers[3].rotation,
    Layers[4].effect("IK Control").property("Upper Length"), 
    Layers[4].effect("IK Control").property("Lower Length"), 
    Layers[4].effect("IK Control").property("Rotation Freeze"), 
    Layers[4].effect("IK Control").property("Clockwise"), 
    Layers[4].position, 
    Layers[4].rotation,
    ]//将目标属性储存进数组中   
    for (var i = 0; i < Props.length; i++) {
        tarProp = Props[i];
        if (tarProp.numKeys > 0) {
            keyIndex = tarProp.nearestKeyIndex(curTime);
            keyTime = tarProp.keyTime(keyIndex);
            //如果目标属性有关键帧，则获得离当前时间最近的关键帧
            if (keyTime == curTime) {
              tarProp.setSelectedAtKey(keyIndex,true);
            }//如果关键帧关键帧时间为当前时间，则选中
            
        } 
    }//使用循环遍历数组    
}
function ResetLegL() {
    var curComp = app.project.activeItem;
    var curTime = app.project.activeItem.time;
    var Layers = [
        curComp.layer("CtrlMain_thigh_L"),
        curComp.layer("Ctrl_thigh_L"),
        curComp.layer("Ctrl_leg_L"),
        curComp.layer("Ctrl_ankle_L"),
        curComp.layer("Ctrl_ankle_L_IK"),
    ]//将目标图层储存进数组中
    Layers[0].effect("Customize").property("Round 1").setValueAtTime(curTime,100);
    Layers[0].effect("Customize").property("Round 2").setValueAtTime(curTime,100);
    Layers[0].effect("Customize").property("Elbow 1").setValueAtTime(curTime,false);
    Layers[0].effect("Customize").property("Elbow 2").setValueAtTime(curTime,true);
    Layers[0].effect("Order").property("Order 1").setValueAtTime(curTime,0.1);
    Layers[0].effect("Order").property("Order 2").setValueAtTime(curTime,0.1);
    Layers[0].effect("IK to FK").property("Slider").setValueAtTime(curTime,0);
    //Main
    Layers[1].rotation.setValueAtTime(curTime,0); 
    //thighL
    Layers[2].position.setValueAtTime(curTime,[0,140]);
    Layers[2].rotation.setValueAtTime(curTime,0);
    //legL
    Layers[3].effect("Sabun").property("Slider").setValueAtTime(curTime,1);
    Layers[3].position.setValueAtTime(curTime,[0,140]);
    Layers[3].rotation.setValueAtTime(curTime,0);
    //ankleL
    Layers[4].effect("IK Control").property("Upper Length").setValueAtTime(curTime,140);
    Layers[4].effect("IK Control").property("Lower Length").setValueAtTime(curTime,140); 
    Layers[4].effect("IK Control").property("Rotation Freeze").setValueAtTime(curTime,true); 
    Layers[4].effect("IK Control").property("Clockwise").setValueAtTime(curTime,100);
    Layers[4].position.setValueAtTime(curTime,[0,0]);
    Layers[4].rotation.setValueAtTime(curTime,0);
    //IK
}
  

