function AddHandBKey() {
    var curComp = app.project.activeItem;
    var curTime = app.project.activeItem.time;
    curComp.layer("Ctrl_headTurn").rotation.addKey(curTime);
    curComp.layer("Ctrl_bodyTurn").rotation.addKey(curTime);
    //==============================
    curComp.layer("Ctrl_head").rotation.addKey(curTime);
    curComp.layer("Ctrl_head").position.addKey(curTime);
    curComp.layer("Ctrl_head").effect("Nod").property("Slider").addKey(curTime);
    //==============================
    curComp.layer("Ctrl_upbody").rotation.addKey(curTime);
    curComp.layer("Ctrl_upbody").position.addKey(curTime);
    curComp.layer("Ctrl_upbody").effect("Bow").property("Slider").addKey(curTime);
    //==============================
    curComp.layer("Ctrl_body").rotation.addKey(curTime);
    curComp.layer("Ctrl_body").position.addKey(curTime);
}
function SelectHandB() {
    var curComp = app.project.activeItem;
    var curTime = app.project.activeItem.time;
    var Props = [
        curComp.layer("Ctrl_headTurn").rotation,
        curComp.layer("Ctrl_bodyTurn").rotation,
        //==============================
        curComp.layer("Ctrl_head").rotation,
        curComp.layer("Ctrl_head").position,
        curComp.layer("Ctrl_head").effect("Nod").property("Slider"),
        //==============================
        curComp.layer("Ctrl_upbody").rotation,
        curComp.layer("Ctrl_upbody").position,
        curComp.layer("Ctrl_upbody").effect("Bow").property("Slider"),
        //==============================
        curComp.layer("Ctrl_body").rotation,
        curComp.layer("Ctrl_body").position    
    ]
    //将目标属性储存进数组中
    for (var i = 0; i < Props.length; i++) {
        tarProp = Props[i];
        if (tarProp.numKeys > 0) {
            keyIndex = tarProp.nearestKeyIndex(curTime);
            keyTime = tarProp.keyTime(keyIndex);
            //如果目标属性有关键帧，则获得离当前时间最近的关键帧
            if (keyTime == curTime) {
              tarProp.setSelectedAtKey(keyIndex,true);
            }
            //如果关键帧关键帧时间为当前时间，则选中
          } 
    }    
}
function ResetHAndB() {
    var curComp = app.project.activeItem;
    var curTime = app.project.activeItem.time;
    curComp.layer("Ctrl_headTurn").rotation.setValueAtTime(curTime,0);
    curComp.layer("Ctrl_bodyTurn").rotation.setValueAtTime(curTime,0);
    //==============================
    curComp.layer("Ctrl_head").rotation.setValueAtTime(curTime,0);
    curComp.layer("Ctrl_head").position.setValueAtTime(curTime,[0,0]);
    curComp.layer("Ctrl_head").effect("Nod").property("Slider").setValueAtTime(curTime,0);
    //==============================
    curComp.layer("Ctrl_upbody").rotation.setValueAtTime(curTime,0);
    curComp.layer("Ctrl_upbody").position.setValueAtTime(curTime,[0,0]);
    curComp.layer("Ctrl_upbody").effect("Bow").property("Slider").setValueAtTime(curTime,0);
    //==============================
    curComp.layer("Ctrl_body").rotation.setValueAtTime(curTime,0);
    curComp.layer("Ctrl_body").position.setValueAtTime(curTime,[0,0]);
}
  

